import React from 'react';
import PROJECTS from '../service/projects';
import './Projects.css';

export default function FrontEndProj({id}) {
  useEffect(() => {
    const projeto = PROJECTS.filter((project) => project.id === id);
  }, [id]);

  return (
    <section className="projects-container">
     <h1>Testando</h1>
     <div className="project-front-end-card">
        <img alt="Luciano Lanes Lopes" className="project-pic"/>
        <div className="project-info">
          <p></p>
        </div>
    </div>
    </section>
  )
}
